import React from 'react';
import './TodoSearch.css';

function TodoSearch() {
  const [search, setValue] = React.useState('');

  const onSearchValueChange = (event) => {
    setValue(event.target.value);
  };
  return [
    <input 
    className="TodoSearch" 
    placeholder="Cebolla" 
    value={search}
    onChange={onSearchValueChange}
    />,
    <p>
      {search}
    </p>
  ];


}

export { TodoSearch };
